import React, { useEffect, useState } from "react";
import { useSpring, animated } from "react-spring";
import "./Nt.module.scss"; // Import your CSS file for styling

const Nt = () => {
  const [show, setShow] = useState(false);

  useEffect(() => {
    setShow(true);
  }, []);

  const nProps = useSpring({
    opacity: show ? 1 : 0,
    transform: show ? "translateY(0px)" : "translateY(100px)",
    config: { tension: 100, friction: 20 },
  });

  const tProps = useSpring({
    opacity: show ? 1 : 0,
    transform: show ? "translateY(0px)" : "translateY(100px)",
    config: { tension: 100, friction: 20 },
  });

  return (
    <div className="logo-container">
      <animated.div className="n" style={nProps}>
        N
      </animated.div>
      <animated.div className="t" style={tProps}>
        T
      </animated.div>
    </div>
  );
};

export default Nt;
